use std::hash::Hasher;
use std::io::Cursor;
use murmur3::murmur3_x64_128;
use fnv::*;


pub struct HyperLogLog{

    // wait why are the buckets u8 what
    buckets: Vec<u8>,
    number_of_bits: u8,

    // NOTE: 
    //  set is the number of buckets so it can just be a u32
    //  (if the bits are restricted to [4, 16])
    
    // set: f64,
    set: u32,
}

const HLL_MIN_PRECISION: u8 = 4;
const HLL_MAX_PRECISION: u8 = 16;

impl HyperLogLog{
    // NOTE:
    //  number of bits is not the number of buckets,
    //  the number of buckets is 2^(number_of_bits)
    //  so range is actually [4, 16] bits and [16, 65536] buckets
    
    /// will panic if number of buckets is not in range [4,16]
    pub fn new(number_of_bits: u8) -> Self{
        if number_of_bits < HLL_MIN_PRECISION || number_of_bits > HLL_MAX_PRECISION{
            panic!("Number of bits has to be in range [4, 16]!");
        }
        let number_of_buckets = 2u32.pow(number_of_bits as u32);

        let mut buckets: Vec<u8> = Vec::with_capacity(number_of_buckets as usize);
        for _ in 0..number_of_buckets {
            buckets.push(0);
        }

        HyperLogLog {
            number_of_bits,
            buckets,

            // NOTE: set is just the number of registers in array M i.e. the number of buckets
            // set: (2 << number_of_bits) as f64,
            set: number_of_buckets,
        }
    }

    // FIXME: 
    //  murmur over strings seems to yield more evenly distributed hashes, 
    //  and so it picks buckets better than the Fnv Hasher with slices
    // pub fn add(&mut self, data: &[u8]){
    pub fn add(&mut self, data: &str){
        // let mut hasher = FnvHasher::default();
        // hasher.write(data);
        // let hash = hasher.finish();

        let hash = murmur3_x64_128(&mut Cursor::new(data), 420).unwrap();

        // let bucket = hash >> (64 - self.number_of_bits);
        let bucket = hash >> (128 - self.number_of_bits);
        
        // println!("new add starts here");
        // println!("masked:   {}", format!("{:0>64}", format!("{:b}", hash_maybe)));
        // println!("shifted:  {} = {}", format!("{:0>4}", format!("{:b}", bucket)), bucket);

        // println!("zeros: {}", hash.trailing_zeros());
        // let value = (hash << self.number_of_bits).trailing_zeros() + 1;
        // println!("{}", value);
        // if value as u8 > self.buckets[bucket as usize]{
        //     self.buckets[bucket as usize] = value as u8;
        // }
        
        // lower part 
        let lower = hash << self.number_of_bits;

        // why add 1 to the zeros?
        let zeros = lower.trailing_zeros() as u8 + 1;
        if zeros > self.buckets[bucket as usize]{
            self.buckets[bucket as usize] = zeros;
        }

        // println!("hash_bin: {}", format!("{:0>128}", format!("{:b}", hash)));
        // println!("hash: {}", hash);
        // println!("bucket: {}, zeros: {}, value: {:?}", bucket, zeros, data);
        //

    }

    pub fn count(&self) -> f64{
        let mut sum: f64 = 0.0;
        let mut empty_buckets = 0;

        // println!("{:?}", self.buckets);

        for bucket_value in self.buckets.iter(){
            // sum += (2f64.powf(*bucket_value as f64)).powf(-1.0);
            sum += 2f64.powf(-1.0 * *bucket_value as f64);
            if *bucket_value == 0{
                empty_buckets += 1;
            }
        }

        // set is the number of registers (m) in array M
        let m: f64 = self.set as f64;
        let alpha: f64 = 0.7213 / (1.0 + 1.079 / m);

        let mut estimation = alpha * m.powf(2.0) / sum;

        if estimation <= 2.5*m { // small range correction
            println!("small");
            if empty_buckets > 0 {
                estimation = m * (m / empty_buckets as f64).log2();
            }
        }else if estimation > 1.0 / 30.0 * 2.0f64.powf(32.0){ // large range correction
            println!("big");
            estimation = -(2.0f64.powf(32.0)) * (1.0-estimation/2.0f64.powf(32.0)).log2();
        }
        estimation
    }
}

